(function ($) {
    //防止重复设置
    var flag = false;
    var sessionTimeout = false;
    FR.Form.Plugin.Panel.Events.push({
        name: FR.Events.AFTERLOAD,

        action: function () {
            if (isParameterPane(this.options.type) || flag) {
                return;
            }
            flag = true;
            getRefreshConfig(this.sessionID);
        }
    });

    var getRefreshConfig = function (sessionID) {
        FR.ajax({
            url: FR.servletURL,
            data: {
                op: 'form_refresh',
                cmd: 'config',
                sessionID: sessionID,
                _: new Date().getTime()
            },
            async: false,
            complete: function (res, status) {
                if (status == 'success' && res.responseText) {
                    contenConfig = FR.jsonDecode(res.responseText);
                    doSetRefresh(contenConfig);
                }
            }
        });
    }


    var isParameterPane = function (type) {
        //参数面板的form的话不走这边的逻辑
        return type === "parameter";
    };

    var doSetRefresh = function (contenConfig) {
        var reportsConfig = contenConfig.reports;
        if (FR.isEmpty(reportsConfig)) {
            return;
        }

        for (var j = 0, length = reportsConfig.length; j < length; j++) {
            var opts = reportsConfig[j];
            if (FR.isEmpty(opts.Refresh)) {
                continue;
            }

            var state = opts.Refresh.state;
            var interval = opts.Refresh.interval;

            if (state === 0 || interval === 0) {
                continue;
            }
            opts.sessionID = contenConfig.sessionID;
            var refreshFunc = function (opts) {
                return function () {
                    refreshReport(opts);
                }
            };
            window.setTimeout(refreshFunc(opts), interval * 1000);
        }
    };

    var refreshReport = function (opts) {
        if (sessionTimeout) {
            return;
        }
        var widget = _g().getWidgetByName(opts.widgetName);
        if (FR.isEmpty(widget)) {
            //有些控件会在某些操作之后创建，所以这边也要添加定时器
            window.setTimeout(function () {
                refreshReport(opts);
            }, opts.Refresh.interval * 1000);
            return;
        }
        FR.ajax({
            url: FR.servletURL,
            data: {
                op: 'clear_pdl',
                sessionID: opts.sessionID,
                _: new Date().getTime()
            }
        });

        function goToPage(executeStrategy) {
            widget.gotoPage(1, "{}", executeStrategy, false, false, true);

            if (widget.illegalDataPageResult !== undefined) {
                if (
                    [
                        //遇到以下几种报错之后不再刷新了
                        "12400004", //智能释放
                        "12400005", //模板未操作时长过长
                        "12400006", //管理员结束会话
                        "12400007", //会话失效
                    ].indexOf(widget.illegalDataPageResult.errorCode) > 0
                ) {
                    sessionTimeout = true;
                }
            }
        }

        function fun(needRefresh, monitorCell) {
            if (needRefresh) {
                //如果是监控单元数据变化的话，因为后台已经算过一遍了，所以这边直接从缓存中去取不用重新计算
                var executeStrategy = monitorCell ? "" : "lazy";
                var animateProcessor = FR.Report.Plugin.AnimateProcessor;
                var item = animateProcessor.item;
                if (item && FR.Plugin.validLevel(animateProcessor, item) && item.refresh) {
                    item.refresh.call(this, widget, function () {
                        goToPage(executeStrategy);
                    });
                    return;
                }
                goToPage(executeStrategy);
            }
        }

        refreshByArea(opts, fun);
    };

    var refreshByArea = function (opts, callback) {
        var widget = _g().getWidgetByName(opts.widgetName);
        FR.ajax({
            url: FR.servletURL,
            data: {
                op: 'form_refresh',
                cmd: 'area',
                sessionID: opts.sessionID,
                refreshArea: opts.Refresh.refreshArea,
                customClass: opts.Refresh.customClass,
                reportName: opts.widgetName,
                _PAPERWIDTH: widget.widthScale === 1 ? FR.windowWidth : widget.oldWindowWidth,
                _PAPERHEIGHT: widget.heightScale === 1 ? FR.windowHeight : widget.oldWindowHeight,
                _SHOWPARA: $('.parameter-container-collapseimg-down').length === 0,
                _: new Date().getTime()
            },
            complete: function (res, status) {
                var currentTime = new Date().getTime();
                if (status == 'success') {
                    var monitorCell = !!opts.Refresh.refreshArea && !opts.Refresh.customClass;
                    callback(res.responseText === 'true' || FR.isEmpty(opts.Refresh.refreshArea), monitorCell);
                }
                //不管响应的结果失败或者成功都应该重新发请求
                var proccessTime = opts.Refresh.interval * 1000 - new Date().getTime() + currentTime;
                var timeout = proccessTime ? proccessTime : 0;
                window.setTimeout(function () {
                    refreshReport(opts);
                }, timeout);
            }
        });
    };

    !(function () {
        if (typeof BI === "undefined") {
            return;
        }
        BI.action('EVENT_BODY_AFTERLOAD', function (sessionID) {
            getRefreshConfig(sessionID);
        })
    })();
})(jQuery);
